DROP SINK IF EXISTS types_sink;
DROP TABLE IF EXISTS kafka_all_types;
CREATE TABLE IF NOT EXISTS kafka_all_types(
id int,
c_boolean boolean,
c_smallint smallint,
c_integer integer,
c_bigint bigint,
c_decimal decimal,
c_real real,
c_double_precision double precision,
c_varchar varchar,
c_bytea bytea,
c_date date,
c_time time,
c_timestamp timestamp,
c_timestamptz timestamptz,
c_interval interval,
c_jsonb jsonb,
);

CREATE SINK IF NOT EXISTS types_sink
FROM kafka_all_types
WITH (
connector = 'kafka',
properties.bootstrap.server='message_queue:29092',
topic = 'types',
primary_key = 'id'
) FORMAT DEBEZIUM ENCODE JSON;

